!function(){if($("#myCarousel").length){new bootstrap.Carousel("#myCarousel")}if($(".needs-validation").length){const e=document.querySelectorAll(".needs-validation");Array.from(e).forEach((e=>{e.addEventListener("submit",(a=>{e.checkValidity()||(a.preventDefault(),a.stopPropagation()),e.classList.add("was-validated")}),!1)}))}}();